import React, { useState } from 'react';
import './Navbar.css';
import logo from './Pictures/Logo.png';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  return (
    <header className="navbar">
      <div className="navbar__top">
        <div className="navbar__contact">
          <span>Office: (718)-200-0699</span>
          <span>Cell: (718)-300-7014</span>
          <span>30+ Years Experience | Fully Licensed | Fully Insured | MBE Certified Contractor</span>
        </div>
        <button className="navbar__estimate-btn">Free Estimate</button>
      </div>
      <div className="navbar__main">
        <img src={logo} alt="Company Logo" className="navbar__logo" />
        <nav className={`navbar__nav ${isOpen ? 'open' : ''}`}>
          <a href="#home" className="navbar__link">Home</a>
          <a href="#about" className="navbar__link">About Us</a>
          <a href="#services" className="navbar__link">Services</a>
          <a href="#portfolio" className="navbar__link">Our Portfolio</a>
          <a href="#blog" className="navbar__link">Blog</a>
          <a href="#contact" className="navbar__link">Contact Us</a>
        </nav>
        <button className="navbar__menu-toggle" onClick={toggleMenu}>
          <span className="navbar__menu-icon"></span>
        </button>
      </div>
    </header>
  );
};

export default Navbar;
